import React, { useState } from 'react';
import axios from 'axios';
import './view.css';

const Output = () => {
  const [formData, setFormData] = useState({
    month: '',
    year: '',
    circle: '',
  });

  const [outputData, setOutputData] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleGetData = (e) => {
    e.preventDefault();

    // Prepare the API endpoint URL based on the selected options
    let apiUrl = '/view';

    // Build the query parameters based on the selected search options
    const queryParams = {
      circle: circle,
      year: year,
      month: month,
    };

    // Convert the query parameters to a URL-encoded string
    const queryString = new URLSearchParams(queryParams).toString();

    // Append the query string to the API endpoint URL
    apiUrl += `?${queryString}`;

    // Make the API call using axios
    axios
      .get(apiUrl)
      .then((response) => {
        // Handle the response data here
        console.log(response.data); // This will log the data returned from the API
        // Update the state with the fetched data if necessary
        setOutputData(response.data);
      })
      .catch((error) => {
        console.error('Error:', error); // Log the error if something went wrong
        // Optionally, you can handle the error or notify the user
      });
  };

  return (
    <div>
       <h1 className='makesure'>View Data</h1>
      <div className="choosing">

     <div>
     <form onSubmit={handleSubmit}>
       <div className='bsbc'>
       <div className='dsdc'>
          <label htmlFor="circle">Circle:</label>
          <input
            type="text"
            id="circle"
            name="circle"
            value={formData.circle}
            onChange={handleInputChange}
            placeholder="Enter Circle Name"
          />
        </div>
        <div className='dsdc'>
        <label htmlFor="month">Month:</label>
          <input
            type="number"
            id="month"
            name="month"
            value={formData.month}
            onChange={handleInputChange}
            placeholder="Enter Month"
          />
        </div>
        <div className='dsdc'>
          <label htmlFor="year">Year:</label>
          <input
            type="number"
            id="year"
            name="year"
            value={formData.year}
            onChange={handleInputChange}
            placeholder="Enter Year"
          />
        </div >
       </div>
        <button type="submit" className='getMore' onClick={handleGetData}>Get Output</button>
      </form>
     </div>
      {outputData && (
        <div>
          {/* Display the output data here */}
          <pre>{JSON.stringify(outputData, null, 2)}</pre>
        </div>
      )}
    </div>
    </div>
  );
};

export default Output;
